import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import './slider.scss';
import { SlImg, LandE } from './components';
import { NavLink } from 'react-router-dom';

const StaLand = (props) => (
	<section className={props.container}>
		<article className={props.article}>
			<div className="aspect-ratio aspect-ratio--7x5">
				<img src={props.background} className="whale" alt="img" />
			</div>
		</article>
		<div className="db mt2 mt1-m">
			<p className="optima f3 f4-m black fw5 pb2 pb1-m">{props.title}</p>
			<p className="optima f6 silver fw4 ttu">{props.group}</p>
		</div>
	</section>
);

export default class Lima extends Component {
	render() {
		var settings = {
			dots: true,
			fade: true,
			infinite: true,
			speed: 500,
			autoplay: false,
			slidesToShow: 1,
			slidesToScroll: 1,
			className: 'slides',
			arrows: true,
		};
		return (
			<section className="w-70 w-100-m center ">
				<NavLink to="/progetti" className="link ">
					<Slider {...settings}>
						<LandE
							to="https://www.ideascudo.com/homepage/"
							article="dim bg-light-gray"
							background="./img/ideascudo/ideascudo_1.png"
							title="Ideascudo"
							group="logo"
						/>
						<SlImg src="./img/lima/3.png" />
						<SlImg src="./img/lima/1.png" />
						<SlImg src="./img/lima/2.png" />
					</Slider>
				</NavLink>
			</section>
		);
	}
}

